* {
    box-sizing: border-box
}

:focus {
    outline: 0
}

::-webkit-scrollbar {
    display: none
}

html {
    max-width: 500px;
    margin: 0 auto
}

body {
    background: #eee;
    color: #ffffff;
    font-family: Ubuntu, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"
}

a,
a:after,
a:hover,
a:visited {
    text-decoration: none;
    color: #111
}

.p1 {
    padding: 1rem
}

.tc,
p.tc {
    text-align: center
}

h1,
h2,
h3 {
    font-size: 1.38rem
}

body {
    background: url(https://res.cloudinary.com/dkkt8cxre/image/upload/v1742358477/gpc5ystvpmdvjmzzoej4.jpg) center fixed;
    background-size: cover
}

.tb {
    font-weight: bold
}

.ctr {
    padding-left: 1rem;
    padding-right: 1rem
}

.my2 {
    margin-top: 2rem;
    margin-bottom: 2rem
}

.lfr {
    margin: 0 auto
}

.ifr {
    max-width: 300px;
    margin: 0 auto
}

.atas {
    padding-top: 6rem
}

.box {
    margin: 0 1rem;
    background: #282c2d59;
    border-radius: 1rem;
    box-shadow: 0px 3px 8px 3px #282c2d08
}

.tengah {
    padding-bottom: 8rem
}

.optxt p {
    text-align: justify
}

span.b1 {
    font-size: 2rem;
    color: #fdeb38;
    text-shadow: 0 0 8px #8d0f06
}

span.b2 {
    font-size: 2rem;
    color: #dd0703
}

.bawah {
    position: fixed;
    bottom: 0;
    max-width: 500px;
    width: 100%
}

.flex {
    display: flex
}

.col6 {
    width: 50%
}

.py3 {
    padding: 3rem;
}

.bawah .btn {
    display: block;
    line-height: 3rem;
    background: linear-gradient(to top, #5c5c5c, #e100ff);
    letter-spacing: 3px;
    color: white;
}

.bawah .btn:hover {
    background: rgb(0, 76, 57);
}

.bawah .flex {
    margin: 1.38rem;
    box-shadow: 0px 3px 8px 3px #282c2d21;
    border-radius: 1rem;
    backdrop-filter: blur(4px)
}

.btn.log {
    border-radius: 1rem 0 0 1rem;
    background: linear-gradient(to bottom, #e100ff, #5c5c5c);

}

.btn.reg {
    border-radius: 0 1rem 1rem 0
}

.YATOGEL {
    animation: borderAnimation 3s linear infinite;
    border: 2px solid;
    border-radius: 10px;
}

@keyframes borderAnimation {
    0% {
        border-color: #fff;
    }

    25% {
        border-color: #ae7c16;
    }

    50% {
        border-color: #12bae7;
    }

    75% {
        border-color: #7d047688;
    }

    100% {
        border-color: #fff;
    }
}

@media only screen and (max-width: 600px) {
    .py3 {
        padding: 1rem;
    }
}

.header img {
    max-width: 90%;

}

.header {            
    position: sticky;
    top: 0px;
    text-align: center;
    z-index: 99999;
    padding:60px;
}
